import React from "react";
import "./project-button.styles.css";

const ProjectButton = () => (
	<div className="project-button" style={{"width": "100px",
	"background-color": "aliceblue",
	"border": "2px solid blue", "margin": "0 auto"}}>EXPLORE</div>
);

export default ProjectButton;
